import React, { Component } from 'react';
// import ReactDOM from 'react-dom';
import Chart from 'chart.js';
import RadarChart from '../components/2020Graphs/RadarChart';
import SheetLineChart from '../components/2020Graphs/SheetLineChart'
import RadarChart2019 from '../components/2020Graphs/RadarChart2019';
import { BrowserRouter } from 'react-router-dom';


Chart.defaults.global.defaultFontFamily = "Roboto, sans-serif";

// App
class BlogPosts extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <div className="sub chart-wrapper">
            <RadarChart2019
              data={this.state.data[3].data}
              title={this.state.data[3].title}
              colors={['#a8e0ff', '#8ee3f5', '#70cad1', '#3e517a', '#b08ea2', '#BBB6DF']}
            />
          </div>
          <div className="sub chart-wrapper">
            <RadarChart
              data={this.state.data[3].data}
              title={this.state.data[3].title}
              colors={['#a8e0ff', '#8ee3f5', '#70cad1', '#3e517a', '#b08ea2', '#BBB6DF']}
            />
          </div>
            <div className="sub chart-wrapper">
              <SheetLineChart
                data={this.state.data[3].data}
                title={this.state.data[3].title}
                colors={['#a8e0ff', '#8ee3f5', '#70cad1', '#3e517a', '#b08ea2', '#BBB6DF']}
              />
            </div>
        </div>

      </BrowserRouter>
    );
  }
}

// ReactDOM.render(<App />, document.getElementById('root'));

export default BlogPosts;
